import React, { useState } from 'react'

const ProductForm = () => {
  const [title, setTitle] = useState('')
  const [description, setDescription] = useState('')
  const [price, setPrice] = useState(0)

  const handleSubmit = e => {
    e.preventDefault();
    axios.post('localhost:/8000/products/new')

  }
  return (
    <form action="">
      <p>
        Title: <input type="text" value={title} onChange={e => setTitle(e.target.value)}/>
      </p>
      <p>
        Price: <input type="text" value={description} onChange={e => setDescription(e.target.value)}/>
      </p>
      <p>
        Description: <input type="number" value={price} onChange={e => setPrice(e.target.value)}/>
      </p>
    </form>
  )
}

export default ProductForm
